import React, { Component } from 'react'



export default class Plot extends Component {



  render() {
    let ctx = "plotCanvas";
    new Chart(ctx, {
      type: "line",
      bar: {
        datasets : [{
          label: "example",
          borderColor: "blue",
          data: [1,2,3,4,6]
        }]
      }
    })


    return (
      <canvas id="plotCanvas">

      </canvas>
    )
  }
}
